struct audio_t {
	volatile unsigned int control;
	volatile unsigned char rarc;
	volatile unsigned char ralc;
	volatile unsigned char warc;
	volatile unsigned char walc;
    volatile unsigned int ldata;
	volatile unsigned int rdata;
};

struct audio_t *const audiop = ((struct audio_t *)0xff203040);

//simple audio playback without PS2 keyboard polling, audio only plays once
void just_audio_playback(int *samples, int n) {
	int i;

	audiop->control = 0x8; // clear the output FIFOs
	audiop->control = 0x0; // resume input conversion
	for (i = 0; i < n; i++) {
		// wait till there is space in the output FIFO
		while (audiop->warc == 0);
		audiop->ldata = samples[i];
		audiop->rdata = samples[i];
	}
}
	
//plays back audio in endless loop with PS2 keyboard polling implemented every time we write to the audio FIFO
// -> allows key presses while audio is playing, and automatically stops the audio once a key press is detected
// -> otherwise, audio keeps looping until key press is detected
void audio_playback_mono(int *samples, int n) { 
	int i;

	audiop->control = 0x8; // clear the output FIFOs
	audiop->control = 0x0; // resume input conversion
	while(1){
		for (i = 0; i < n; i++) {
			PS2_data = *(PS2_ptr);
			RVALID = (PS2_data & 0x8000);
			if(RVALID != 0) {
				byte1 = byte2;
				byte2 = byte3;
				byte3 = PS2_data & 0xFF;
			}
			if(byte3 == 0x5A && byte2 == 0xF0)
				break;
			// wait till there is space in the output FIFO
			while (audiop->warc == 0);
			audiop->ldata = samples[i];
			audiop->rdata = samples[i];
			
		}
		if(byte3 == 0x5A && byte2 == 0xF0)
			break;
	}
	byte3 = 0;
}

//HELPER FUNCTIONS--------------------------------------------------------------------------------------------------
void swap(int *a, int *b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

int abs(int value){
	return value > 0? value : -value;
}

void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = line_color;
}

void clear_screen() { //clear entire screen by drawing all pixels as black
    for (int x = 0; x <= 319; ++x) {
        for (int y = 0; y <= 239; ++y) {
            plot_pixel(x, y, 0x0); //black color
        }
    }
}

void waiting_for_vsync(){
	volatile int * buffer_ptr = (int *)0xFF203020;
    *buffer_ptr = 1;
    for(int Sbit = *(buffer_ptr + 3) & 1; Sbit != 0; Sbit = *(buffer_ptr + 3) & 1);
}

void draw_line(int x0, int y0, int x1, int y1, short int color){
	int is_steep = abs(y1 - y0) > abs(x1 - x0);
	if(is_steep){
		swap(&x0, &y0);
		swap(&x1, &y1);
	}
	if(x0 > x1){
		swap(&x0, &x1);
		swap(&y0, &y1);
	}
	
	int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax/2);
    int y = y0;

    int y_step = y0 < y1? 1 : -1;

    for (int x = x0; x <= x1; ++x) {
        if (is_steep) {
            plot_pixel(y, x, color);
        } else {
            plot_pixel(x, y, color);
        }
        error = error + deltay;
        if (error > 0) {
            y = y + y_step;
            error = error - deltax;
        }
    }
}

void clear_bg_line(int x0, int y0, int x1, int y1){ //optimized clearing for background lines using background colour instead of black
	short int color;
	int is_steep = abs(y1 - y0) > abs(x1 - x0);
	if(is_steep){
		swap(&x0, &y0);
		swap(&x1, &y1);
	}
	if(x0 > x1){
		swap(&x0, &x1);
		swap(&y0, &y1);
	}
	
	int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax/2);
    int y = y0;

    int y_step = y0 < y1? 1 : -1;

    for (int x = x0; x <= x1; ++x) {
		color = background[y][x];
        if (is_steep) {
            plot_pixel(y, x, color);
        } else {
            plot_pixel(x, y, color);
        }
        error = error + deltay;
        if (error > 0) {
            y = y + y_step;
            error = error - deltax;
        }
    }
}

