#define ADDR_7SEG1 ((volatile long *) 0xFF200020)
#define ADDR_7SEG2 ((volatile long *) 0xFF200030)
	
void display(int number) {
    static const long segments[10] = {
        0x3F, // 0
        0x06, // 1
        0x5B, // 2
        0x4F, // 3
        0x66, // 4
        0x6D, // 5
        0x7D, // 6
        0x07, // 7
        0x7F, // 8
        0x6F  // 9
    };

    if (number >= 0 && number <= 99) {
        int digit1 = number / 10; // First (leftmost) digit
        int digit2 = number % 10; // Second (rightmost) digit

        *ADDR_7SEG1 = segments[digit2] + (segments[digit1] << 8);
        *ADDR_7SEG2 = 0;
    }
}
	
