//PLAYER------------------------------------------------------------------------------------------------------------
void start_init() {
    int startX = (320 - 20) / 2; // Center the image horizontally
    int startY = 200; // Center the image vertically
	int count = 0;
    for (int y = 0; y < 14; y++) {
        for (int x = 0; x < 20; x++) {
            // Calculate the index in the character array
            int index = y * 20 + x;
            // Fetch the color for this pixel
			current_ufo[count].x = startX + x;
            current_ufo[count].y = startY + y;
			count++;
        }
    }
}

void drawImage() { //draw player image
    // Assuming the size of current_locs is equal to the number of pixels in the image
    for (int i = 0; i < 280; i++) {
        // Retrieve the color from the original character array
        // The index i corresponds to the same order the pixels were plotted
        short int color = character[i];
        
        // Retrieve the stored location for this pixel
        int x = current_ufo[i].x;
        int y = current_ufo[i].y;
        if(color == 0x0000) {
			continue;
		}
        // Plot the pixel at the stored location with the original color
        plot_pixel(x, y, color);
    }
}

void clearImage(){ //clear player image with background image
	 for (int i = 0; i < 280; i++) {
        short int color = character[i];

        int x = previous_ufo[i].x;
        int y = previous_ufo[i].y;
		if(color == 0x0000) {
			continue;
		}
		color = background[y][x]; //draw background again instead of black
        plot_pixel(x, y, color);
    }
}
	
void draw_heart(int HP_Level){ //draw heart icons in top right of screen based on current player hp
    if(HP_Level > 2){
        for(int y = 0; y < 26; y++){
            for(int x =0; x < 26; x++){
				if(life[y][x] != 65535)
                	plot_pixel(230+x, 10+y, life[y][x]);
            }
        }
    }
    if(HP_Level > 1){
        for(int y = 0; y < 26; y++){
            for(int x =0; x < 26; x++){
				if(life[y][x] != 65535)
                	plot_pixel(260+x, 10+y, life[y][x]);
            }
        }
    }
    if(HP_Level > 0){
        for(int y = 0; y < 26; y++){
            for(int x =0; x < 26; x++){
                if(life[y][x] != 65535)
					plot_pixel(290+x, 10+y, life[y][x]);
            }
        }
    }
}

void clear_heart(){ //clear the heart icons
    for(int y = 0; y < 26; y++){
        for(int x =0; x < 26; x++){
			if(life[y][x] != 65535)
            	plot_pixel(230+x, 10+y, background[10+y][230+x]);
        }
    }
    for(int y = 0; y < 26; y++){
        for(int x =0; x < 26; x++){
			if(life[y][x] != 65535)
            	plot_pixel(260+x, 10+y, background[10+y][260+x]);
        }
    }
    for(int y = 0; y < 26; y++){
        for(int x =0; x < 26; x++){
            if(life[y][x] != 65535)
				plot_pixel(290+x, 10+y, background[10+y][290+x]);
        }
    }
}

